// frontend/src/pages/dashboard.js
import React, { useEffect, useState } from "react";
import { HeaderContainer, DashboardContainer, FooterContainer } from "../containers";
import { Section, Summary } from "../components";
import BarGraph from "../helpers/graphs";
import TimeSeriesLine from "../helpers/TimeSeriesLine";
import { getPropertyList } from "../redux/actions/propertiesAction";
import { getAgentList } from "../redux/actions/agentsAction"; // optional now
import { api } from "../helpers/api";
import { useDispatch, useSelector } from "react-redux";


const Dashboard = () => {
  const dispatch = useDispatch();

  const { properties } = useSelector((state) => state.propertyList);

  const { agents } = useSelector((state) => state.agentList);

  useEffect(() => {
    dispatch(getAgentList());
    dispatch(getPropertyList());
  }, [dispatch]);




  useEffect(() => {
    (async () => {
      try {
        const data = await api("/api/stats"); // <- our new endpoint
        setStats(data);
      } catch (e) {
        setStatsErr(e.message);
      }
    })();
  }, []);

    return (
    <>
      <HeaderContainer bg={false} />
      <Section bgColor="--bs-fade-info">
        <Section.InnerContainer>
          <DashboardContainer title="Dashboard">
            {/* Top tiles */}
            <Summary.Top>
              <Summary.Anchor to="/listings" bg="var(--bs-yellow)">
                <Summary.Icon name="fas fa-home" />
                <Summary.Title>
                  Total Properties
                  <Summary.Text>{stats ? stats.properties.total : (properties?.length || 0)}</Summary.Text>
                </Summary.Title>
              </Summary.Anchor>

              <Summary.Anchor to="/admin-agents" bg="var(--bs-blue)">
                <Summary.Icon name="fas fa-users" />
                <Summary.Title>
                  Total Users
                  <Summary.Text>{stats ? stats.users.total : 0}</Summary.Text>
                </Summary.Title>
              </Summary.Anchor>
            </Summary.Top>

            {/* Users (last 30 days) */}
            <Summary.Bottom>
              <Summary.BottomHeader>
                <Summary.Title>New users (last 30 days)</Summary.Title>
              </Summary.BottomHeader>
              <Summary.BottomContent>
                {statsErr && <Summary.Text style={{ color: "red" }}>{statsErr}</Summary.Text>}
                {stats && <TimeSeriesLine data={stats.users.by_day} label="Users/day" />}
              </Summary.BottomContent>
            </Summary.Bottom>

            {/* Properties (last 30 days) */}
            <Summary.Bottom>
              <Summary.BottomHeader>
                <Summary.Title>New properties (last 30 days)</Summary.Title>
              </Summary.BottomHeader>
              <Summary.BottomContent>
                {stats && <TimeSeriesLine data={stats.properties.by_day} label="Properties/day" />}
              </Summary.BottomContent>
            </Summary.Bottom>

            {/* Properties by category (existing Bar) */}
            <Summary.Bottom>
              <Summary.BottomHeader>
                <Summary.Title>Properties by category</Summary.Title>
              </Summary.BottomHeader>
              <Summary.BottomContent>
                <BarGraph properties={properties || []} />
              </Summary.BottomContent>
            </Summary.Bottom>

            {/* Newest users (last 30 days) */}
            <Summary.Bottom>
              <Summary.BottomHeader>
                <Summary.Title>Newest users (last 30 days)</Summary.Title>
              </Summary.BottomHeader>
              <Summary.BottomContent>
                {stats && (
                  <div style={{ overflowX: "auto" }}>
                    <table style={{ width: "100%", borderCollapse: "collapse" }}>
                      <thead>
                        <tr>
                          <th style={{ textAlign: "left", padding: 8, borderBottom: "1px solid #eee" }}>Name</th>
                          <th style={{ textAlign: "left", padding: 8, borderBottom: "1px solid #eee" }}>Email</th>
                          <th style={{ textAlign: "left", padding: 8, borderBottom: "1px solid #eee" }}>Created</th>
                        </tr>
                      </thead>
                      <tbody>
                        {stats.users.last_30d_new.map(u => (
                          <tr key={u.id}>
                            <td style={{ padding: 8, borderBottom: "1px solid #f5f5f5" }}>{u.name || "-"}</td>
                            <td style={{ padding: 8, borderBottom: "1px solid #f5f5f5" }}>{u.email}</td>
                            <td style={{ padding: 8, borderBottom: "1px solid #f5f5f5" }}>
                              {new Date(u.created_at).toLocaleString()}
                            </td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                )}
              </Summary.BottomContent>
            </Summary.Bottom>
          </DashboardContainer>
        </Section.InnerContainer>
      </Section>
      <FooterContainer />
    </>
  );
};

export default Dashboard;
